window.bookSummaryJSON = "<p>Jeff Winston's life is not how he imagined it would be.&nbsp;&nbsp;</p> <p>An unhappy marriage and unrewarding job - and then he died. Aged 43. And woke up again, back in his college room, in 1963, age 18. With all his memories intact. If he applies those memories, he can be rich - he can have anything he wants - in this new chance at life.&nbsp;&nbsp;</p> <p>Until he dies at 43 and wakes up in his 18-year-old body again...and again in a continuous 25-year cycle, each time starting from scratch at the age of 18 to reclaim lost loves, make a fortune or remedy past mistakes. And then, in one replayed life, he meets a woman who knows all too well what he is experiencing.&nbsp;&nbsp;&nbsp;</p> <p><i>Replay</i> is a novel of gripping adventure, romance and fascinating speculation on the nature of time. <i>Replay</i> asks the question, 'What if you could live your life over again?'&nbsp;&nbsp;</p>"; 
